   function bicubicImgInterpolation(selector){
       var elem = document.querySelector(selector);

       var imgW = elem.offsetWidth;
       var imgH = elem.offsetHeight;

       var url = deepCSS(elem, 'background-image');
       url = /url\(['"]?([^")]+)/.exec(url) || [];
       url = url[1];

       var canvasOuter = document.createElement('canvas');
       canvasOuter.width = imgW;
       canvasOuter.height = imgH;
       canvasOuter.style = 'display: none';

       drawCanvas(canvasOuter, imgW*6, imgH*6, url, drawHighResolutionImgThumbnail, elem);
   }


   function drawCanvas(canvOuter, imgW, imgH, src, callback, imgEl) {
       var outerCanvCtx = canvOuter.getContext('2d');

       var innerImg = new Image();
       innerImg.setAttribute('crossOrigin', 'anonymous');

       var w = imgW;
       var h = imgH;

       innerImg.onload = function() {
           var canvInner = document.createElement('canvas');

           canvInner.width = w;
           canvInner.height = h;
           var innerCanvCtx = canvInner.getContext('2d');
           innerCanvCtx.drawImage(innerImg, 0, 0, w/2, h/2);
           innerCanvCtx.drawImage(canvInner, 0, 0, w/2, h/2, w/2, h/2, w/4, h/4);
           outerCanvCtx.drawImage(canvInner, w/2, h/2, w/4, h/4, 0, 0, w/6, h/6);

           if (callback) {
               callback(canvOuter, this.src, imgEl);
           }
       };

       innerImg.src = src;
   }


   function drawHighResolutionImgThumbnail(can, attrSrc, imgEl) {
       var bgStyle = "background-image: url('"+can.toDataURL('image/png')+"')";
       imgEl.setAttribute('style', bgStyle);
   }


   function deepCSS(who, css) {
       if (!who || !who.style)
           return '';

       var sty = css.replace(/\-([a-z])/g, function (a, b) {
           return b.toUpperCase();
       });

       if (who.currentStyle) {
           return who.style[sty] || who.currentStyle[sty] || '';
       }

       var dv = document.defaultView || window;

       return who.style[sty] ||
           dv.getComputedStyle(who, '').getPropertyValue(css) || '';
   }
</script>

